import React from "react";
import "./App.css"
import Home from "./components/home/Home";
import { Route, Routes } from "react-router-dom";


function App() {
  return (
    <React.Fragment>
      <div className="page_layout">
        <Home />
      </div>
      <Routes>
        <Route >

        </Route>
        <Route path="/login" element={<>Login</>} />
        <Route path="/signup" element={<>Login</>} />
      </Routes>
    </React.Fragment>
  )

}

export default App;
